Hungry for Change

Health-Medical Documentary hosted by James Colquhoun and Laurentine Bosch, published by Food Matters in 2013 - English narration


Information
------------------------------

Hungry for Change
From the creators of the best-selling documentary Food Matters come's another hard-hitting film certain to rock your world. Hungry for Change exposes shocking secrets the diet, weight loss and food industry don't want you to know about: deceptive strategies designed to keep you coming back for more. Find out what's keeping you from having the body and health you deserve and how to escape the diet trap forever. Featuring interviews with bestselling health authors and leading medical experts plus real-life transformational stories with people who know what it's like to be sick and overweight.

